import {NavLink} from "react-router-dom";
import './NavBar.css'

const NavBar = () =>{
    return(
        <nav className="NavBar">
            <NavLink className="NavBar-link" exact to="/">Home</NavLink>
            <NavLink className="NavBar-link" exact to="/about">About</NavLink>
            <NavLink className="NavBar-link" exact to="/projects/previous">Previous Projects</NavLink>
            <NavLink className="NavBar-link" exact to="/projects/current">Current Projects</NavLink>
            <NavLink className="NavBar-link" exact to="/resume">Resume</NavLink>
        </nav>
    )
}

export default NavBar;
